import Card from "./Card";
import database from "../data_storage/database";

const Projects = () => {
  const makeCard = () => {
    // const keys = Object.keys(database);
    const values = Object.values(database);
    const entries = Object.entries(database); // Return array of key-value pairs
    console.log(entries.length);
    entries.forEach(function each(item) {
      for (let i = 0; i < entries.length; i++) {
        for (let j = 0; j < entries[i].length; j++) {
          console.log(entries[i][j]);
        }
      }

      if (Array.isArray(item)) {
        // If is array, repeat loop
        item.forEach(each);
        return (
          <Card
            id={entries[0][0]}
            quote={entries[0][1].quote}
            description={entries[0][1].description}
          />
        );
      } else {
        console.log(item);
      }
    });
    // entries.forEach(() => {
    //   return (
    //     <Card
    //       id={entries[0][0]}
    //       quote={entries[0][1].quote}
    //       description={entries[0][1].description}
    //     />
    //   );
    // });
  };

  return (
    <section className="main">
      <div>
        <h1>Selected Projects</h1>
      </div>
      <ul>{makeCard()}</ul>
      <style jsx>
        {`
          .main {
            display: flex;
            flex-direction: column;
            margin: 0 120px;
            text-align: center;
          }
          h1 {
            font-size: 45px;
            margin-bottom: 50px;
          }
        `}
      </style>
    </section>
  );
};

export default Projects;
